import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import { BSwitch } from 'react-router-dom';
import StartMenue from './components/StartMenue';
import Vereine from './components/Vereine/Vereine';
import Login from './components/Login';
import Mitglieder from './components/Mitglieder/Mitglieder';
import Veranstaltungen from './components/Veranstaltungen';
import Teilnehmer from './components/Teilnehmer';
import Kosten from './components/Kosten';
import Reisekosten from './components/Reisekosten';
import Teilnehmerliste from './components/Teilnehmerliste';
import Erhebungsbogen from './components/Erhebungsbogen';
import Anmeldung from './components/Anmeldung';
import Abrechnung from './components/Abrechnung';
import AusgabeReisekosten from './components/AusgabeReisekosten';

function App () {
  return (
    <Router>
      <Switch>
      <Route exact path="/" component={StartMenue} />
        <Route path="/vereine" component={Vereine} />
        <Route path='/login' component={Login} />

          <Route path='/mitglieder' component={Mitglieder} />
          <Route path='/veranstaltungen' component={Veranstaltungen} />
          <Route path='/teilnehmer' component={Teilnehmer} />
          <Route path='/kosten' component={Kosten} />
          <Route path='/reisekosten' component={Reisekosten} />
          <Route path='/teilnehmerliste' component={Teilnehmerliste} />
          <Route path='/erhebungsbogen' component={Erhebungsbogen} />
          <Route path='/anmeldung' component={Anmeldung} />
          <Route path='/abrechnung' component={Abrechnung} />
        <Route path='/ausgabeReisekosten' component={AusgabeReisekosten} />
      </Switch>
      </Router>
  );
};

export default App;
